import React from 'react';
import './Product.css'
const Product = (props) => {
    const {img,category,name,price}= props.product;
    return (
        <div className='product'>
            <div>
                <img src={img} alt=""  />
            </div>
            <div>
                <h3>category: {name}</h3>
            </div>
            <h3>{props.product.category}:</h3>
            <h5>{props.product.name}</h5>
        </div>
    );
}; 

export default Product;
